import Hero from "../components"
import Navbar from "../components/Navbar"
import Footer from "../components/Footer";
import Visualize from "../components/Visualize";

function Visualization(){
    return(
        <>
        <Navbar /> 
        <Hero 
        cName="hero-mid"
        heroImg={AboutImg}
        title="Contact"
        btnClass="hide"
        />
        <Visualize />
        <Footer />
        </>
    )
}

export default Visualization;
